import '../Styles/register.css';
import React, {useState} from 'react'


function Register() {

  const [name, setName] = useState('');
  const [password, setPassword] = useState('');
  const [lastName, setLastName] = useState('');
  const [mail, setMail] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    const formData = {
      nameSend: name,
    }

    axios
      .post('/register',formData)
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      })
  }

  return (
    <div className="App">
      <div className="App-header">
        <div>
         <h1>Register</h1>
         <form>
          <input type="text" placeholder="name" className="name" value={name} onChange={e => setName(e.target.value)} required/>
          <input type="text" placeholder="last name" className="lastname"/>
          <input type="text" placeholder="mail" className="name"/>
          <input type="text" placeholder="password" className="name"/>
         </form>

        </div>

        <div clasName="register">
        <button><a href="#">Registrarte</a></button>

      </div>
      </div>    
    </div>
  );
}

export default Register;
